const runSingleTest = (romDump, { LEN, A }) => {
  const system = new Emulator({ memoryDump: romDump });

  const { memory, registers } = system;

  let addr = 0x800;
  for (const a of A) {
    memory[addr] = a & 0xFF;
    memory[addr + 1]  = a >> 8;
    addr += 2;
  }

  memory[0x3E02] = LEN & 0xFF;
  memory[0x3E03] = LEN >> 8;
  memory[0x3E0C] = 0x00;
  memory[0x3E0D] = 0x00;
  memory[0x3E0E] = 0x00;

  registers.H = 0x3E;

  while (!system.isFinished) {
    system.instruction();
  }

  const result = [];
  for (let i = 0, addr = 0x800; i < A.length; i++, addr += 2) {
    result.push(memory[addr] + (memory[addr + 1] << 8));
  }

  return { result, elapsedStates: system.tStates };
};

const generateRamDump = (A, LEN, initialMemory) => {
  const ramDump = new Uint8Array(2 ** 14 - 0x800);

  let addr = 0x0;
  for (const a of A) {
    ramDump[addr] = a & 0xFF;
    ramDump[addr + 1]  = a >> 8;
    addr += 2;
  }

  ramDump.set(initialMemory.slice(0x3E00), 0x3E00 - 0x800);

  ramDump[0x3E02 - 0x800] = LEN & 0xFF;
  ramDump[0x3E03 - 0x800] = LEN >> 8;

  return ramDump;
};

(function main() {
  const { memory, sourceCode } = compileCodeForTest('submodules/updateArray.i8008', { funcName: 'updateArray' });

  let sum = 0n;
  for (const [testNo, { LEN, A, result: expected }] of TESTS.entries()) {
    console.log(`Running test #${testNo}...`);
    const initialMemory = memory.slice();
    const { result, elapsedStates } = runSingleTest(memory, { LEN, A });
    if (result.join(',') !== expected.join(',')) {
      console.log(`Test failed!`);

      console.log('Code to reproduce:');
      console.log(updateCodeForUseInEmulator(sourceCode, [generateRegisterInitialization('H', 0x3E)]));

      const dumpPath = path.resolve('./ram.dump');
      fs.writeFileSync(dumpPath, generateRamDump(A, LEN, initialMemory));
      console.log(`RAM dump saved at path: ${dumpPath}`);

      process.exit(1);
    }

    sum += (elapsedStates - PROLOGUE_STATES_COUNT);
  }

  console.log('All tests are passed!');
  console.log(`Avg execution time: ${sum / BigInt(TESTS.length)} states`);
}());
